function SearchResults() {

    function resultFunction() {
        return (
        <ul>
            <li>song 1 <button type='button'>+</button></li> 
            <li>song 2 <button type='button'>+</button></li> 
            <li>song 3 <button type='button'>+</button></li> 
            <li>song 4 <button type='button'>+</button></li> 
        </ul>
        )
    }



    return(
        <>
            <h2>Search Results</h2>
            {resultFunction()}
        </>
    )
}

export default SearchResults;
